import React from "react";
import "../styles/Hero.css";

function Home() {
  return (
    <section className="hero">
      <h2>Hey there, I'm</h2>
      <h1>Jose Chemmanoor</h1>
      <p className="animated-text">Student | UI/UX Designer | Front-End Developer</p>
      <div className="btn-container">
        <a href="/about" className="neon-box">Get to Know More About Me</a>
      </div>
    </section>
  );
}

export default Home;
